import { CardElement, useElements, useStripe } from "@stripe/react-stripe-js"
import axios from "axios"
import { useState } from "react"

const CARD_OPTIONS = {
    iconStyle: "solid",
    style: {
        base: {
            iconColor: "#c4f0ff",
            color: "#fff",
            fontWeight: 500,
            fontFamily: "Roboto, Open Sans, Segoe UI, sans-serif",
            fontSize: "16px",
            fontSmoothing: "antialiased",
            ":-webkit-autofill": { color: "#fce883" },
            "::placeholder": { color: "#87bbfd" }
        },
        invalid: {
            iconColor: "#ffc7ee",
            color: "#ffc7ee"
        }
    }
}

const ServerPlan = (props) => {

    const [cardInfo, setCardInfo] = useState({
        email: "",
        cardNumber: "",
        cardDate: "",
        cardCVC: ""
    })

    const paymentSelection = (value) => {
        switch (value) {
            case "sub":
                return subscriptionPayment();
            case "oneTime":
                return OneTimePayment();
            default:
                return OneTimePayment();
        }
    }

    const OneTimePayment = () => {
        return (
            <div className="paymentOneTimeMainContainer">
                <div className="paymentOneTimeEmail">
                    <input type="text" value={cardInfo.email} onChange={(e) => {
                        setCardInfo({
                            ...cardInfo,
                            email: e.target.value
                        })
                    }} />
                    <form className="Form" onSubmit={handleSubmit}>
                        <fieldset className="FormGroup">
                            <Field
                                label="Name"
                                id="name"
                                type="text"
                                placeholder="Jane Doe"
                                required
                                autoComplete="name"
                                value={cardInfo.name}
                                onChange={(e) => {
                                    setCardInfo({ ...cardInfo, name: e.target.value });
                                }}
                            />
                            <Field
                                label="Email"
                                id="email"
                                type="email"
                                placeholder="janedoe@gmail.com"
                                required
                                autoComplete="email"
                                value={cardInfo.email}
                                onChange={(e) => {
                                    setCardInfo({ ...cardInfo, email: e.target.value });
                                }}
                            />
                            <Field
                                label="Phone"
                                id="phone"
                                type="tel"
                                placeholder="(941) 555-0123"
                                required
                                autoComplete="tel"
                                value={cardInfo.phone}
                                onChange={(e) => {
                                    setCardInfo({ ...cardInfo, phone: e.target.value });
                                }}
                            />
                        </fieldset>
                        <fieldset className="FormGroup">
                            <CardField
                                onChange={(e) => {
                                    setError(e.error);
                                    setCardComplete(e.complete);
                                }}
                            />
                        </fieldset>
                        {error && <ErrorMessage>{error.message}</ErrorMessage>}
                        <SubmitButton processing={processing} error={error} disabled={!stripe}>
                            Pay $25
                        </SubmitButton>
                    </form>
                </div>
                <div className="paymentOneTimeCardDetails">
                    <span>Pay with card</span>
                </div>
                <CardElement options={CARD_OPTIONS} />
            </div>
        )
    }

